INSERT INTO `v1_7477c390e7b6de58ba35dcf44158c2719e9ba639c3e008dbaf0bd7bec67b96ab` VALUES (2, 2, "調子が上がって\nきたなっ", 3000, 2, 1000, "vo_minigame_1013_icon_2_002_001", "vo_minigame_1013_icon_1_002_001", "訓練はまだ\nここからですわ", 1);
INSERT INTO `v1_7477c390e7b6de58ba35dcf44158c2719e9ba639c3e008dbaf0bd7bec67b96ab` VALUES (2, 2, "ほらほら、\nまだいけるだろ？", 3000, 2, 5000, "vo_minigame_1013_icon_2_003_001", "vo_minigame_1013_icon_1_003_001", "クスクス、悪くない\n流れですわね", 2);
INSERT INTO `v1_7477c390e7b6de58ba35dcf44158c2719e9ba639c3e008dbaf0bd7bec67b96ab` VALUES (2, 3, "へへっ、おまえら\nやるじゃねえか！", 3000, 2, 10000, "vo_minigame_1013_icon_2_004_001", "vo_minigame_1013_icon_1_004_001", "すばらしい\n記録ですわ", 3);
INSERT INTO `v1_7477c390e7b6de58ba35dcf44158c2719e9ba639c3e008dbaf0bd7bec67b96ab` VALUES (2, 3, "あたしたちはまだ\n止まらねえぜ！", 3000, 3, 10000, "vo_minigame_1013_icon_2_005_001", "vo_minigame_1013_icon_1_005_001", "乗りに乗って\nいますわね", 4);
INSERT INTO `v1_7477c390e7b6de58ba35dcf44158c2719e9ba639c3e008dbaf0bd7bec67b96ab` VALUES (2, 3, "見てろよ！\nマコト班の快進撃だ！", 3000, 3, 10000, "vo_minigame_1013_icon_2_005_002", "vo_minigame_1013_icon_1_005_002", "まだまだ行きます\nついてきなさい", 5);
INSERT INTO `v1_7477c390e7b6de58ba35dcf44158c2719e9ba639c3e008dbaf0bd7bec67b96ab` VALUES (2, 3, "うおぉぉっ！\n絶好調だぜ！", 3000, 3, 10000, "vo_minigame_1013_icon_2_005_003", "vo_minigame_1013_icon_1_005_003", "エリコ班の\n本領発揮ですわ！", 6);
INSERT INTO `v1_7477c390e7b6de58ba35dcf44158c2719e9ba639c3e008dbaf0bd7bec67b96ab` VALUES (2, 3, "どこまで行けるか\n楽しみだなっ！", 3000, 4, 0, "vo_minigame_1013_icon_2_006_001", "vo_minigame_1013_icon_1_006_001", "ここからは\n前人未到の領域です！", 7);
INSERT INTO `v1_7477c390e7b6de58ba35dcf44158c2719e9ba639c3e008dbaf0bd7bec67b96ab` VALUES (3, 4, "まだ諦めんなよっ", 1000, 5, 1, "vo_minigame_1013_icon_2_007_001", "vo_minigame_1013_icon_1_007_001", "厄介でしたわ…", 8);
INSERT INTO `v1_7477c390e7b6de58ba35dcf44158c2719e9ba639c3e008dbaf0bd7bec67b96ab` VALUES (3, 4, "冷やっとしたぜ…！", 1000, 5, 1, "vo_minigame_1013_icon_2_007_002", "vo_minigame_1013_icon_1_007_002", "油断大敵です", 9);
INSERT INTO `v1_7477c390e7b6de58ba35dcf44158c2719e9ba639c3e008dbaf0bd7bec67b96ab` VALUES (3, 4, "弱音を吐くなっ", 1000, 5, 1, "vo_minigame_1013_icon_2_007_003", "vo_minigame_1013_icon_1_007_003", "忌々しいっ…", 10);
INSERT INTO `v1_7477c390e7b6de58ba35dcf44158c2719e9ba639c3e008dbaf0bd7bec67b96ab` VALUES (4, 3, "マコト班集合！", 1500, 6, 99, "vo_minigame_1013_icon_2_008_001", "vo_minigame_1013_icon_1_008_001", "大所帯ですわね", 11);
INSERT INTO `v1_7477c390e7b6de58ba35dcf44158c2719e9ba639c3e008dbaf0bd7bec67b96ab` VALUES (4, 3, "連携してくぞ！", 1500, 6, 99, "vo_minigame_1013_icon_2_008_002", "vo_minigame_1013_icon_1_008_002", "エリコ班へようこそ", 12);
INSERT INTO `v1_7477c390e7b6de58ba35dcf44158c2719e9ba639c3e008dbaf0bd7bec67b96ab` VALUES (1, 6, "みんなに力を！", 3000, 8, 0, "vo_minigame_1013_icon_2_020_001", "vo_minigame_1013_icon_1_020_001", "ナナカちゃんに\nお任せあれ", 13);
